DROP TABLE new_students;

CREATE TABLE new_students (
	new_student_id		serial primary key,
	last_name			varchar(50),
	first_name			varchar(50),
	middle_name			varchar(50),
	acct_no				varchar(50),
	degree_code			varchar(50)
);



UPDATE new_students SET degree_code = 'INRM' WHERE degree_code = 'IRM';
UPDATE new_students SET degree_code = 'POSC' WHERE degree_code = 'PLSC';
UPDATE new_students SET degree_code = 'FUNU' WHERE degree_code = 'NUDT';
UPDATE new_students SET degree_code = 'PGRE' WHERE degree_code = 'RELG';
UPDATE new_students SET degree_code = 'SOWO' WHERE degree_code = 'SOWK';

UPDATE majors SET departmentid = 'MBBS' WHERE departmentid is null;

	studentid, surname, firstname, othernames, departmentid, accountnumber, newstudent)
SELECT 'CHRI', 0, 'M', 'S', 'NG', 'NG', 'NG', 39,
	'NU/' || lpad(CAST(4256 + new_students.new_student_id as varchar), 4, '0'), 
	new_students.last_name, new_students.first_name, new_students.middle_name,
	majors.departmentid, trim(upper(new_students.acct_no)), true
FROM new_students INNER JOIN majors ON trim(upper(new_students.degree_code)) = trim(upper(majors.majorid));

SELECT 'B.A', 'NU/' || lpad(CAST(4256 + new_students.new_student_id as varchar), 4, '0'), 
	'UNDM', 3, 0
FROM new_students ;


SELECT studentdegrees.studentdegreeid, new_students.degree_code, 0
FROM new_students INNER JOIN studentdegrees ON studentdegrees.studentid = ('NU/' || lpad(CAST(4256 + new_students.new_student_id as varchar), 4, '0'));



